require 'rails_helper'

RSpec.describe 'Image API', type: :request do
  let(:password) { "123123" }
  let!(:user)  { create(:user, password: password) }
  let(:image) { create(:image) }
  let(:image_id) { image.id }


  let(:valid_attributes) { { user_id: user.id, base64: "" } }
  let(:without_base64) { { user_id: user.id } }

  # Test suite for GET /images/:id
  describe 'GET /images/:id' do
    context 'when the record exists' do
      before { get "/images/#{image_id}" }

      it 'returns status code 200' do
        expect(response).to have_http_status(200)
      end
    end

    context 'when the record does not exist' do
      let(:image_id) { 100 }

      before { get "/images/#{image_id}" }

      it 'returns status code 404' do
        expect(response).to have_http_status(404)
      end

      it 'returns a not found message' do
        expect(response.body).to match("")
      end
    end
  end

  # Test suite for GET /images/:id/get_with_size
  describe 'GET /images/:id/get_with_size' do
    context 'when the record exists' do
      before { get "/images/#{image_id}/get_with_size" }

      it 'response not empty' do
        expect(json).not_to be_nil
      end

      it 'returns status code 200' do
        expect(response).to have_http_status(200)
      end
    end

    context 'when the record does not exist' do
      let(:image_id) { 100 }

      before { get "/images/#{image_id}/get_with_size" }

      it 'returns status code 404' do
        expect(response).to have_http_status(404)
      end

      it 'returns a not found message' do
        expect(response.body).to match("")
      end
    end
  end

  # Test suite for POST /images/
  describe 'POST /images' do
    context 'when the request is valid' do
      before do
        post "/auth/login", params: { email: user.email, password: password}
        token = json['token']

        post "/images", params: valid_attributes, headers: { 'Authorization': token }
      end

      it 'creates an image' do
        expect(json).not_to be_nil
      end

      it 'returns status code 200' do
        expect(response).to have_http_status(200)
      end
    end

    context 'when the request without base64' do
      before do
        post "/auth/login", params: { email: user.email, password: password}
        token = json['token']

        post "/images", params: without_base64, headers: { 'Authorization': token }
      end

      it 'returns status code 422' do
        expect(response).to have_http_status(422)
      end

      it 'returns a validation failure message' do
        expect(response.body)
          .to match("{\"base64\":[\"can't be blank\"]}")
      end
    end

    context 'when the user unauthorized' do
      before do
        post "/images", params: valid_attributes
      end

      it 'returns status code 403' do
        expect(response).to have_http_status(403)
      end

      it 'response is empty' do
        expect(response.body).to match("")
      end
    end

    context 'do not changes user' do
      before do
        post "/auth/login", params: { email: user.email, password: password}
        token = json['token']

        post "/images", params: valid_attributes, headers: { 'Authorization': token }
        post "/auth/login", params: { email: user.email, password: password}
      end

      it 'token not be empty' do
        expect(json['token']).to be_kind_of(String)
      end

      it 'status be ok' do
        expect(response).to have_http_status(200)
      end
    end
  end

  # Test suite DELETE 'images/:id'
  describe 'DELETE /images' do
    context 'when the request is valid' do
      before do
        post "/auth/login", params: { email: user.email, password: password}
        token = json['token']
        user.image_id = image.id
        user.save

        delete "/images/#{image_id}", params: { user_id: user.id }, headers: { 'Authorization': token }
      end

      it 'returns status code 200' do
        expect(response).to have_http_status(200)
      end
    end

    context 'when image doesn\'t exists' do
      before do
        post "/auth/login", params: { email: user.email, password: password}
        token = json['token']

        delete "/images/100", params: { user_id: user.id }, headers: { 'Authorization': token }
      end

      it 'returns status code 404' do
        expect(response).to have_http_status(404)
      end

      it 'returns empty message' do
        expect(response.body).to match("")
      end
    end

    context 'when the user not owner' do
      before do
        post "/auth/login", params: { email: user.email, password: password}
        token = json['token']

        delete "/images/#{image_id}", params: { user_id: 100 }, headers: { 'Authorization': token }
      end

      it 'returns status code 403' do
        expect(response).to have_http_status(403)
      end

      it 'returns empty message' do
        expect(response.body).to match("")
      end
    end

    context 'when the user unauthorized' do
      before do
        delete "/images/#{image_id}", params: { user_id: user.id}
      end

      it 'returns status code 403' do
        expect(response).to have_http_status(403)
      end

      it 'response is empty' do
        expect(response.body).to match("")
      end
    end
  end
end
